import { Grid } from "@mui/material";
import React from "react";

function PhotoGallery() {
  return (
    <Grid container>
      <Grid item xs={12} lg={12}>
        <CoverBox firstLine="Become" secondLine="our PARTNER" />
      </Grid>
    </Grid>
  );
}

export default PhotoGallery;
